import React from 'react'
import { connect } from 'react-redux';

function ScoreTable({user, score}) {
  return (
    <div>
     <h1></h1> {user}
      {score}
    </div>
  )
}

const mapStateToProps = (state) => {
  return {
    user: state.user,
    score: state.score
  };
};

export default connect(mapStateToProps)(ScoreTable);
